import { Box, withStyles } from "@material-ui/core";
import React from "react";

interface IProps {
  isOpen: boolean;
  handleClose: Function;
}

const Dialog: React.FC<IProps> = ({ isOpen, handleClose }) => {
  return (
    <>
      {isOpen && (
        <>
          <Container onClick={() => handleClose()}></Container>
          <Modal>yoo</Modal>
        </>
      )}
    </>
  );
};

export default Dialog;

const Container = withStyles({
  root: {
    position: "fixed",
    top: 0,
    left: 0,
    bottom: 0,
    right: 0,
    backgroundColor: "black",
    opacity: 0.5,
    zIndex: 10000,
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
})(Box);

const Modal = withStyles({
  root: {
    opacity: 1,
    zIndex: 20000,
  },
})(Box);
